const PREVIEW_LOOKUP = {"d1e3": {"l": "./images.html#images","t": "Images","d": "<p class=\"shortdesc\"> Documentation and examples for opting images into responsive behavior (so they never become larger than     their parent elements) and add lightweight styles to them—all via classes. </p> "},"d1e72": {"l": "./button-group.html#button-group","t": "Button Group","d": "<p class=\"shortdesc\"> Group a series of buttons together on a single line or stack them in a vertical column. </p> "},"d1e250": {"l": "./tabs.html#tabs","t": "Tabbed Dialogs","d": "<p class=\"shortdesc\"> Use the tab JavaScript plugin to extend Bootstrap’s navigational tabs and pills to create tabbable panes of     local content. </p> "},"d1e402": {"l": "./utilities.html#utilities","t": "Borders, Color and Background","d": "<p class=\"shortdesc\"> Use border utilities to quickly style the border and border-radius of an element and convey meaning through<span class=\"ph codeph\"> color </span>and<span class=\"ph codeph\"> background-color </span>with a handful of color utility classes. </p> "},"d1e777": {"l": "./carousel.html#carousel","t": "Carousel","d": "<p class=\"shortdesc\"> A slideshow component for cycling through elements—images or slides of text—like a carousel. </p> "},"d1e908": {"l": "./grid.html#grid","t": "Grid System","d": "<p class=\"shortdesc\"> Use Bootstrap’s powerful mobile-first flexbox grid to build layouts of all shapes and sizes thanks to a     twelve column system, six default responsive tiers, Sass variables and mixins, and dozens of predefined     classes. </p> "},"d1e1019": {"l": "./dark-mode.html#dark-mode","t": "Dark Mode","d": "<p class=\"shortdesc\"> Bootstrap 5.3 supports color modes, starting with dark mode. You can implement your own color mode toggler onto a static menu bar and apply the different color modes as you see fit. Bootstrap supports a light mode (default) and now dark mode. Color modes can be toggled globally on the<span class=\"keyword markupname xmlelement\"> html </span>element, or on specific components and elements, thanks to the<span class=\"keyword markupname xmlatt\"> data-bs-theme </span>attribute. </p> "},"d1e1068": {"l": "./breadcrumb.html#breadcrumb","t": "Breadcrumb","d": "<p class=\"shortdesc\"> Indicate the current page’s location within a navigational hierarchy that automatically adds separators via     CSS. </p> "},"d1e1178": {"l": "./pagination.html#pagination","t": "Pagination","d": "<div class=\"abstract\"> <p class=\"shortdesc\"> Documentation and examples for showing pagination to indicate a series of related content exists across       multiple pages. </p><p class=\"p\"> Bootstrap uses a large block of connected links for pagination, making links hard to miss and easily scalable—all       while providing large hit areas. Pagination is built with <span class=\"keyword markupname xmlelement\"> ol </span> DITA elements so screen       readers can announce the number of available links. They are wrapped in an HTML <span class=\"keyword markupname xmlelement\"> nav </span>element to identify them as a navigation sections to screen readers and other assistive technologies. </p><p class=\"p\"> In addition, as pages likely have more than one such navigation section, it’s advisable to provide a descriptive       aria-label by placing the <span class=\"keyword markupname xmlelement\"> ol </span>within a dedicated<span class=\"keyword markupname xmlelement\"> section </span>with a<span class=\"keyword markupname xmlelement\"> title </span>for the<span class=\"keyword markupname xmlelement\"> nav </span> to reflect its purpose. For example, if the       pagination component is used to navigate between a set of search results, an appropriate         <span class=\"keyword markupname xmlelement\"> title </span>could be<span class=\"ph i\"> \"Search results pages\" </span>. </p> </div> "},"d1e1485": {"l": "./list-group.html#list-group","t": "List Group","d": "<p class=\"shortdesc\"> List groups are a flexible and powerful component for displaying a series of content. Modify and extend     them to support just about any content within. </p> "},"d1e1575": {"l": "./figures.html#figures","t": "Figures","d": "<div class=\"abstract\"> <p class=\"shortdesc\"> Documentation and examples for displaying related images and text with the figure component in       Bootstrap. </p><p class=\"p\"> Anytime you need to display a piece of content—like an image with an optional caption, consider using a DITA<span class=\"keyword markupname xmlelement\"> fig </span>element. Bootstrap CSS classes<span class=\"keyword markupname xmlatt\"> class=\"figure\" </span>,<span class=\"keyword markupname xmlatt\"> class=\"figure-img\" </span>, and<span class=\"keyword markupname xmlatt\"> class=\"figure-caption\" </span> are automatically included to       the output to provide some baseline styles for the HTML5 <span class=\"keyword markupname xmlelement\"> figure </span>and<span class=\"keyword markupname xmlelement\"> figcaption </span>elements. </p> </div> "},"d1e1768": {"l": "./rtl.html#rtl","t": "Right-to-Left Language Support","d": "<p class=\"shortdesc\"> You can enable support for right-to-left (RTL) text via the default language setting,<span class=\"keyword markupname xmlatt\"> xml:lang </span>attribute, or<span class=\"keyword markupname xmlatt\"> dir </span>attribute. </p> "},"d1e1887": {"l": "./badge.html#badges","t": "Badges","d": "<p class=\"shortdesc\"> Documentation and examples for badges, Bootstrap’s small count and labeling component. </p> "},"d1e2014": {"l": "./search-box.html#search-box","t": "Search Box","d": "<p class=\"shortdesc\"> Add a full-text search function to your menu bar by installing another plug-in. </p> "},"d1e2173": {"l": "./buttons.html#buttons","t": "Buttons","d": "<p class=\"shortdesc\"> Use Bootstrap’s custom button styles for actions in forms, dialogs, and more with support for multiple     sizes, states, and more. </p> "},"d1e2276": {"l": "./popovers.html#popovers","t": "Popovers","d": "<p class=\"shortdesc\"> Documentation and examples for adding Bootstrap popovers, like those found in iOS, to any element on your     site. </p> "},"d1e2437": {"l": "./collapse.html#collapse","t": "Collapse","d": "<p class=\"shortdesc\"> Toggle the visibility of content across your project with a few classes and Bootstrap’s JavaScript     plugin. </p> "},"d1e2538": {"l": "./alerts.html#alerts","t": "Alerts","d": "<p class=\"shortdesc\"> Provide contextual feedback messages for typical user actions with the handful of available and flexible     alert messages. </p> "},"d1e2763": {"l": "./index.html#index","t": "DITA Bootstrap","d": "<div class=\"abstract\"> <p class=\"shortdesc\"> A plug-in for<a class=\"xref\"> DITA Open Toolkit </a> that extends the       default HTML5 output with a       <a class=\"xref\"> Bootstrap 5.3 </a> template and       components. </p><p class=\"p\"> Where necessary, the texts describing the usage of each component have been copied directly from the<a class=\"xref\"> official Bootstrap 5.3         documentation </a>, however DITA markup is used throughout the examples describing how to implement these       components correctly using the DITA <span class=\"keyword markupname xmlatt\"> outputclass </span>attribute. This text is therefore a derivative of<cite class=\"cite\"> Bootstrap 5 docs </cite>by Twitter, Inc. and the Bootstrap Authors, and used under<a class=\"xref\"> CC BY 3.0. </a> </p> </div> "},"d1e3691": {"l": "./tables.html#tables","t": "Tables","d": "<p class=\"shortdesc\"> Documentation and examples for styling DITA tables with Bootstrap classes. </p> "},"d1e4775": {"l": "./accordion.html#accordion","t": "Accordion","d": "<p class=\"shortdesc\"> Build vertically collapsing accordions in combination with Bootstrap’s Collapse JavaScript     plugin. </p> "},"d1e4927": {"l": "./scrollspy.html#scrollspy","t": "Scrollspy","d": "<p class=\"shortdesc\"> Automatically update a side-bar ToC using Bootstrap navigation or list group components based on scroll     position to indicate which link is currently active in the viewport. </p> "},"d1e5117": {"l": "./offcanvas.html#offcanvas","t": "Offcanvas","d": "<p class=\"shortdesc\"> Build hidden sidebars into your project for navigation, shopping carts, and more with a few classes and     Bootstrap’s JavaScript plugin. </p> "},"d1e5355": {"l": "./typography.html#typography","t": "Typography","d": "<p class=\"shortdesc\"> Documentation and examples for Bootstrap typography, including global settings, headings, body text, lists,     and more. </p> "},"d1e5900": {"l": "./card.html#cards","t": "Cards","d": "<p class=\"shortdesc\"> Bootstrap’s cards provide a flexible and extensible content container with multiple variants and     options. </p> "},"d1e6111": {"l": "./tooltips.html#tooltips","t": "Tooltips","d": "<p class=\"shortdesc\"> Documentation and examples for adding custom Bootstrap tooltips with CSS and JavaScript using CSS3 for     animations and <span class=\"ph codeph\"> data-bs-attributes </span>for local title storage. </p> "},"d1e6294": {"l": "./icons.html#icons","t": "Icons","d": "<p class=\"shortdesc\"> When enabled, DITA Bootstrap includes Bootstrap Icons by default. Additional icon libraries such as<a class=\"xref\"> Font Awesome </a><a class=\"xref\"> Feather </a>and<a class=\"xref\"> Octicons </a> can also be added using     command line parameters. </p> "}};
const BASE_URL = 'https://infotexture.github.io/dita-bootstrap/';

// Parse search results into HTML
function parseLunrResults(results) {
  const html = [];
  for (let i = 0; i < results.length; i++) {
    const id = results[i]["ref"];
    const item = PREVIEW_LOOKUP[id];
    const title = item["t"];
    const preview = item["d"];
    const link = item["l"];
    const result =
      '<p><span class="h3"><a href="' +
      BASE_URL + 
      link +
      '">' +
      title +
      "</a></span></p>" +
      preview;
    html.push(result);
  }
  if (html.length) {
    return html.join("");
  } else {
    return "<p>Your search returned no results.</p>";
  }
}

function formatResults(results) {
  return `<article role="article">
		<div class="modal-header">
	        <h1>Search Results</h1>
	        <button type="button" class="btn-close" aria-label="Close" onclick="closeSearch(this);"></button>
	    </div>
	    <div class="modal-body">
		${parseLunrResults(results)}
		</div>
		</article>`;
}

function escapeHtml(unsafe) {
  return unsafe
    .replace(/&/g, "&amp;")
    .replace(/</g, "&lt;")
    .replace(/>/g, "&gt;")
    .replace(/"/g, "&quot;")
    .replace(/'/g, "&#039;");
}

function showResultCount(query, total, domElementId) {
  if (total == 0) {
    return;
  }

  var s = "";
  if (total > 1) {
    s = "s";
  }
  var found = "<p>Found " + total + " result" + s;
  if (query != "" && query != null) {
    query = escapeHtml(query);
    var forQuery = ' for <span class="result-query">' + query + "</span>";
  } else {
    var forQuery = "";
  }
  var element = document.getElementById(domElementId);
  element.innerHTML = found + forQuery + "</p>";
}

function closeSearch(el) {
  const elements = document.getElementsByClassName("bs-main");
  elements[1].remove();
  elements[0].classList.remove("collapse");
  return false;
}

function search(el) {
  const query = document.getElementById("search-input").value;
  const idx = lunr.Index.load(LUNR_DATA);
  // Write results to page
  const results = idx.search(query);
  const elements = document.getElementsByClassName("bs-main");

  if (elements.length < 2) {
    const resultHtml = `<main role="main" class="container bs-main">
	    	${formatResults(results)}</main>`;

    elements[0].insertAdjacentHTML("afterend", resultHtml);
  } else {
    elements[1].innerHTML = formatResults(results);
  }

  elements[0].classList.add("collapse");
  window.scrollTo(0,0);
  return false;
}
